import axios from "axios";
import { useState } from "react";

interface User {
	id: number,
	email: string,
	firstName?: string,
	lastName?: string,
	userName?: string,
}

function GetAllUsers(): User[] {

	const users: Array<User> = [];

	axios.get('http://localhost:3001/user')
	.then(response => {
		response.data.forEach((element: User) => {
			users.push(element);
		});
	});
	return users;
}

const App:React.FC = () =>
{
	const [users, setUsers] = useState(null);


	// const users: User[] = GetAllUsers();

	return (
		<div> 
			<h1>These are all the Users!</h1>
			<ul>
				{users.map(element => {
					return (<li>{element.email}</li>)
				})}
			</ul>
		</div>
		);
}

export default App;
